query:
/*+ NoHashJoin(t mi_idx) NoHashJoin(mi_idx t mc) */ select count(*)
from title AS t
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id AND t.kind_id = 1 AND mi_idx.info_type_id = 100
inner join movie_companies AS mc
on t.id = mc.movie_id AND mc.company_id < 476 AND mc.company_type_id = 1;
